import React from 'react';
import ChildComponent from './childComponent'


class ParentComponent extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            details :{
                name: "Ravi Kumar",
                age: 23,
                address:"New delhi"
            }
        }
    }
    componentDidMount(){
        this.setState({
            details :{
                name: "Deepak",
                age: 100,
                address:"Kolkatta"
            }
        })
    }
    render(){
        return (
            <ChildComponent userDetails={this.state.details}/>
        )
    };
};

export default ParentComponent
